import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import ArtistList from './components/artist_list';
import AlbumDetails from './components/album_details';
import SearchBar from './components/search_bar';

const App = () => {
  return (
    <Router>
      <div>
        <SearchBar />
        <Switch>
          <Route path="/" exact component={ArtistList} />
          <Route path="/album/:id" component={AlbumDetails} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
